<html><body><text id="wikipedia_ug_wikipedia_org__9669.html" ns="0" revid="129999" sourceurl="https://ug.wikipedia.org/wiki/%D8%A6%D9%89%D9%81%D8%A7%D9%8A%D9%84%DB%87%D8%AA_%D8%AA%DB%95%DA%AD%D8%B1%D9%89%D9%82%DB%87%D8%AA" title="ئىفايلۇت تەڭرىقۇت" type="wikipedia">ئىفايلۇت تەڭرىقۇت<p><ref target="https://ug.wikipedia.org/wiki/كىئۇفۇيۇتى_تەڭرىقۇت">كىئۇفۇيۇتى تەڭرىقۇت</ref>نىڭ ئىنىسى ، مىلادىيە 57-يىلىدىن 59-يىلىغىچە تەختە ئولتۇرغان ، ئۇ تەختتە ئولتۇرغان مەزگىلدە ، شىمالىي ھۇنلاردىن قۇيچۇ مىڭدىن ئارتۇق ئادەمنى باشلاپ كېلىپ جەنۇبىي ھۇنلارغا تەسلىم بولغان ، ئۇ مىلادىيە 59-يىلى ۋاپات بولغان .</p></text></body></html>
